                fillOpacity: 0.8
            }).bindPopup(`<b>${odp.odp}</b><br>Jenis: ${jenisText}<br>Sisa: ${odp.sisa}<br>
                <a href="https://www.google.com/maps?q=${odp.lat},${odp.long}" 
                   target="_blank" rel="noopener noreferrer">
                   Lihat di Google Maps
                </a>`);
            
            marker.odpData = odp;
            
            // Tambahkan ke semua layer ODP yang relevan
            odpLayers["Semua ODP"].addLayer(marker);
            odpLayers[`Jenis ${odp.jenis}`].addLayer(marker);
        });

        // Tambahkan Polygon ke layer
        polygonData.forEach(function(poly) {
			const tahapText = tahapDeskripsi[poly.tahap] || poly.tahap;        
            const polygon = L.polygon(poly.coords, {
                color: tahapColors[poly.tahap],
                fillOpacity: 0.3,
                weight: 2
            }).bindPopup(`<b>Polygon : ${poly.name}</b><br><b>STO : ${poly.sto}</b><br>Tahap: ${tahapText}`);
            
            polygon.polyData = poly;
            
            // Tambahkan ke semua layer polygon yang relevan
            polygonLayers["Semua Polygon"].addLayer(polygon);
            polygonLayers[`Tahap ${poly.tahap}`].addLayer(polygon);
        });

        // Tambahkan layer utama ke peta
        orderLayers["Semua Order"].addTo(map);
        odpLayers["Semua ODP"].addTo(map);
        polygonLayers["Semua Polygon"].addTo(map);

        // Buat struktur layer control dengan grouping
        const layerControl = L.control.layers(baseLayers, null, {collapsed: false}).addTo(map);

        // Tambahkan group layer Order
        layerControl.addOverlay(orderLayers["Semua Order"], "Order/Semua Order");
        layerControl.addOverlay(orderLayers["Layanan I"], "Indihome");
        layerControl.addOverlay(orderLayers["Layanan H"], "Indibiz");

        // Tambahkan group layer ODP
        layerControl.addOverlay(odpLayers["Semua ODP"], "Kategori ODP");
        layerControl.addOverlay(odpLayers["Jenis R"], "Red");
        layerControl.addOverlay(odpLayers["Jenis Y"], "Yellow");
        layerControl.addOverlay(odpLayers["Jenis O"], "Orange");
        layerControl.addOverlay(odpLayers["Jenis G"], "Green");
        layerControl.addOverlay(odpLayers["Jenis B"], "Black");

        // Tambahkan group layer Polygon
        layerControl.addOverlay(polygonLayers["Semua Polygon"], "Semua Polygon JPP");
        layerControl.addOverlay(polygonLayers["Tahap 00"], "Usulan TA");
        layerControl.addOverlay(polygonLayers["Tahap 01"], "Draft");
        layerControl.addOverlay(polygonLayers["Tahap 02"], "Wait Approval AI");
        layerControl.addOverlay(polygonLayers["Tahap 03"], "Not Yet Assigned Permit");
        layerControl.addOverlay(polygonLayers["Tahap 04"], "Assigned Permit");
        layerControl.addOverlay(polygonLayers["Tahap 05"], "Process Permit");
        layerControl.addOverlay(polygonLayers["Tahap 06"], "Finished Permit");
        layerControl.addOverlay(polygonLayers["Tahap 07"], "Approved Permit");
        layerControl.addOverlay(polygonLayers["Tahap 08"], "Rejected Permit");
        layerControl.addOverlay(polygonLayers["Tahap 09"], "Assigned On-Site Survey");
        layerControl.addOverlay(polygonLayers["Tahap 10"], "Finished Survey");
        layerControl.addOverlay(polygonLayers["Tahap 11"], "Pending");
        layerControl.addOverlay(polygonLayers["Tahap 12"], "Lanjut Design");
        layerControl.addOverlay(polygonLayers["Tahap 13"], "Drop On-Site Survey");

        // Fungsi pencarian
        const searchInput = document.getElementById('searchInput');
        const searchResults = document.getElementById('searchResults');

        searchInput.addEventListener('input', function() {
            const searchTerm = this.value.toLowerCase();
            searchResults.innerHTML = '';
            
            if (searchTerm.length < 2) return;
            
            // Cari di Order
            orderData.forEach(function(order) {
                if (order.order.toLowerCase().includes(searchTerm)) {
                    addSearchResult(`Pelanggan: ${order.order}`, [order.lat, order.long], "Order");
                }
            });
            
            // Cari di ODP
            odpData.forEach(function(odp) {
                if (odp.odp.toLowerCase().includes(searchTerm)) {
                    addSearchResult(`ODP: ${odp.odp}`, [odp.lat, odp.long], "ODP");
                }
            });
        });

        function addSearchResult(text, coords, layerType) {
            const item = document.createElement('div');
            item.className = 'search-result-item';
            item.textContent = text;
            item.addEventListener('click', function() {
                map.setView(coords, 18);
                
                // Cari layer yang sesuai dan buka popup
                if (layerType === "Order") {
                    orderLayers["Semua Order"].eachLayer(function(layer) {
                        if (layer.orderData && layer.orderData.order === text.replace('Pelanggan: ', '')) {
                            layer.openPopup();
                        }
                    });
                } else if (layerType === "ODP") {
                    odpLayers["Semua ODP"].eachLayer(function(layer) {
                        if (layer.odpData && layer.odpData.odp === text.replace('ODP: ', '')) {
                            layer.openPopup();
                        }
                    });
                }
                
                searchResults.innerHTML = '';
                searchInput.value = '';
            });
            searchResults.appendChild(item);
        }

        // Inisialisasi fitur gambar
        const drawnItems = new L.FeatureGroup();
        map.addLayer(drawnItems);

        const drawControl = new L.Control.Draw({
            edit: {
                featureGroup: drawnItems
            },
            draw: {
                polygon: false,
                polyline: false,
                rectangle: false,
                circle: false,
                marker: false,
                circlemarker: false
            }
        });
        map.addControl(drawControl);

        // Custom draw controls
        document.getElementById('drawPolygon').addEventListener('click', function() {
            new L.Draw.Polygon(map, drawControl.options.draw).enable();
        });

        document.getElementById('drawMarker').addEventListener('click', function() {
            new L.Draw.Marker(map, drawControl.options.draw).enable();
        });

        document.getElementById('clearAll').addEventListener('click', function() {
            drawnItems.clearLayers();
            updateCoordinatesOutput();
        });

        // Event listener untuk gambar yang dibuat
        map.on(L.Draw.Event.CREATED, function(e) {
            const layer = e.layer;
            drawnItems.addLayer(layer);
            updateCoordinatesOutput();
            
            // Tambahkan popup untuk marker
            if (e.layerType === 'marker') {
                const latLng = layer.getLatLng();
                layer.bindPopup(`Marker:<br>Lat: ${latLng.lat.toFixed(6)}<br>Lng: ${latLng.lng.toFixed(6)}`);
            }
            
            // Tambahkan popup untuk polygon
            if (e.layerType === 'polygon') {
                const latLngs = layer.getLatLngs()[0];
                const coordCount = latLngs.length;
                layer.bindPopup(`Polygon dengan ${coordCount} titik`);
            }
        });

        // Fungsi untuk update output koordinat
        function updateCoordinatesOutput() {
            const features = [];
            
            drawnItems.eachLayer(function(layer) {
                if (layer instanceof L.Marker) {
                    const latLng = layer.getLatLng();
                    features.push({
                        type: 'marker',
                        lat: latLng.lat,
                        lng: latLng.lng,
                        coords: [latLng.lat, latLng.lng]
                    });
                } else if (layer instanceof L.Polygon) {
                    const latLngs = layer.getLatLngs()[0];
                    const coords = latLngs.map(ll => [ll.lat, ll.lng]);
                    features.push({
                        type: 'polygon',
                        coords: coords
                    });
                }
            });
            
            const output = features.map(feat => {
                if (feat.type === 'marker') {
                    return `[${feat.lat}, ${feat.lng}]`;
                } else if (feat.type === 'polygon') {
                    const coordsStr = feat.coords.map(c => `[${c[0]}, ${c[1]}]`).join(', ');
                    return `[${coordsStr}]`;
                }
            }).join('\n');
            
            document.getElementById('coordinatesOutput').textContent = output || 'Belum ada data...';
        }

        // Copy output
        document.getElementById('copyOutput').addEventListener('click', function() {
            const output = document.getElementById('coordinatesOutput').textContent;
            navigator.clipboard.writeText(output).then(() => {
                alert('Output berhasil disalin!');
            });
        });

        // Clear output
        document.getElementById('clearOutput').addEventListener('click', function() {
            drawnItems.clearLayers();
            updateCoordinatesOutput();
        });

	  // Update panel value dari data
    	document.getElementById("jumlahOrder").textContent = orderData.length;
	    document.getElementById("jumlahODP").textContent = odpData.length;        
	    document.getElementById("jumlahPolygon").textContent = polygonData.length;        

		const jumlahTahap00 = polygonData.filter(p => p.tahap === "00").length;
		document.getElementById("jumlahTahap00").textContent = jumlahTahap00;


    </script>
</body>
</html>
